import React from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './NavBar'
import MainBody from './MainBody'
import Footer from './Footer'

function App() {
  return (
    <div className="App">
      <NavBar />
      <MainBody />
      <Footer />
    </div>
  );
}

export default App;
